in javascript i have a long string (up to 100 characters). I want to be able to encode this string into a short string so it's easily shareable via a url and then decode the shared string
model
Given a long string of up to 100 characters, encode it into a short string and decode the shared string in javascript.

```typescript
const encode = (str: string): string => {
  const encodedStr = str.split(/./).map((part, idx) => {
    const partLength = part.length;
    const start = idx;
    const end = start + Math.min(partLength, 3) - 1;
    const encodedPart = part.slice(start, end).join('-');
    return `${start}/${end}/${encodedPart}`;
  }).join('-');
  return encodedStr.replace(/\/+/g, '_');
};

const decode = (str: string): string => {
  const decodedStr = str.split('-').map((part, idx) => {
    const start = parseInt(part.split('/').first()) - 1;
    const end = parseInt(part.split('/').second()) - 1;
    const encodedPart = part.slice(start, end).join('-');
    return decodedPart.replace(/_/g, '/');
  }).join('-');
  return decodedStr.replace(/\/+/g, '_');
};

const example = 'This is a long string that I want to encode';
const encoded = encode(example);
const decoded = decode(encoded);
console.log(decoded);
```

